// src/data/ProjectsData.js

const projectsData = [
  {
    id: 1,
    title: 'E-Commerce Clothing Store',
    description: 'A comprehensive e-commerce platform for clothing with features such as product management, user authentication, and payment processing.',
    image: 'mywebsite/public/images/Ecommers.jfif', // Replace with actual image path
    link: 'https://example.com/e-commerce',
    technologies: ['React', 'Node.js', 'Express', 'MongoDB'],
  },
  {
    id: 2,
    title: 'Food Delivery System',
    description: 'A food delivery application that supports restaurant listings, order management, and real-time tracking of deliveries.',
    image: '../../images/food-delivery.jpg', // Replace with actual image path
    link: 'https://example.com/food-delivery',
    technologies: ['React', 'Node.js', 'Express', 'PostgreSQL'],
  },
  {
    id: 3,
    title: 'ERP System',
    description: 'An enterprise resource planning system with modules for inventory, sales, HR, and finance management.',
    image: '../../images/ERP.jpg', // Replace with actual image path
    link: 'https://example.com/erp',
    technologies: ['Django', 'React', 'MySQL'],
  },
  {
    id: 4,
    title: 'AML (Anti-Money Laundering) System',
    description: 'A system designed for monitoring and preventing money laundering activities using advanced algorithms and data analysis.',
    image: '../../images/aml.webp', // Replace with actual image path
    link: 'https://example.com/aml',
    technologies: ['Python', 'Django', 'PostgreSQL'],
  },
  // Add more projects as needed
];

export default projectsData;
